<p>
3DGenBench is a web server for scoring performance of 3D genomic models.
3DGenBench provides two challenges.
The first challenge aims at quantifying how accurate a model predicts experimental data.
The second benchmark aims to estimate how well a model can predict changes in chromosome folding caused by structural genomic mutations.
</p>

<h1>Overview</h1>

<p>
There are five steps required to obtain 3DGenBench scores:
</p>

<ol>
<li><a href="#Explore_hic_dataset">Explore reference Hi-C dataset</a></li>
<li><a href="#predict">Generate computational predictions of Hi-C contacts for one or multiple samples</a>
(<a href="https://genedev.bionet.nsc.ru/hic_out/by_Project/INC_COST_3DBenchmark/predicted_examples/">see example data</a>)</li>
<li><a href="#uploading">Upload your predictions to 3DGenBench server</a></li>
<li><a href="#compute_metrics">Provide samples metadata and compute metrics</a></li>
<li><a href="#explore_metrics">Explore metrics</a></li>
</ol>

<aside><p>
Want a Quick Start? Go <a href="submission_form.php" target="_blank">here</a> and use <code>Add Test Unit</code> button!
</p></aside>

<h2 id="Explore_hic_dataset" class="content-subhead">Step 1. Explore Hi-C Dataset<a href="#Explore_hic_dataset" class="content-link" title="Heading anchor"></a></h2>

<p>
There are two main dataset types for prediction.
Rearrangement dataset (hereafter <strong>Paired</strong>) contains capture Hi-C and complementary epigenetic data, such as CTCF ChIP-seq, for wild-type and mutated samples (<i>Homo sapiens</i>, <i>Mus musculus</i>, <i>Drosophila melanogaster</i> cell lines).
Genomic region dataset (hereafter <strong>Single</strong>) contains loci for prediction larger than 10&nbsp;Mbp without known chromosome rearrangements.
Those datasets can be found <a href="datasets.php" target="_blank">here</a>.
</p>

<p>
Sample metadata include the following information:
</p>

<p>
<code>chr</code>, <code>start prediction</code> and <code>end prediction</code> columns describe the genomic region for which Hi-C interactions are expected to be predicted.
<code>Rearr #n Start</code>, <code>Rearr #n end</code> columns describe the rearrangement coordinates.
For each sample there are several columns for rearrangement coordinates if multiple simultaneous mutations have been found in the region.
The rearrangement type can be found in <code>Rearrangement Type</code> column.
Also pay attention to the sample cell type, genomic assembly used, and available Hi-C map resolutions (5, 10, 20, 25, or 50&nbsp;kb).
</p>

<p>
Hi-C maps for wild-type and mutated conditions are available in the most commonly used formats: <a href="https://github.com/aidenlab/juicer/wiki/Data/#hic-files" target="_blank">hic</a>, <a href="https://cooler.readthedocs.io/en/latest/schema.html" target="_blank">cool</a> (for 5, 10, 20, 25, or 50&nbsp;kb resolution), and pairs.
Also, for most datasets we provided supplementary tracks describing CTCF binding.
All the data can be downloaded via hyperlinks in the table.
If you need to all available Hi-C data for one particular sample, please follow links in <code>WT Archived Data</code> or <code>MUT Archived Data</code> columns.
Also you can explore dataset folder at our local FTP storage using hyperlinks in <code>WT FTP Folder</code> or <code>MUT FTP Folder</code> columns.
</p>

