<p>
The detailed description of files can be found <a href="tutorial.php" target="_blank">here</a>.
</p>

<p>
If you neet to download the entire Hi-C data set, use command:
</p>

<div class="code"><pre>
wget -r -np https://genedev.bionet.nsc.ru/hic_out/by_Project/INC_COST_3DBenchmark/hic_dataset_zipped/
</pre></div>

<aside><p>
Note: Total size of all available tracks is about 300&nbsp;GB.
</p></aside>

<p>
Also, you can download CTCF data in narrowPeak data format using links in <code>CTCF Data</code> column.
These files have 2 additional columns with information about CTCF binding site orientation calculated using <a href="https://github.com/vanheeringen-lab/gimmemotifs" target="_blank">GimmeMotifs</a>.
</p>

<p>
If you want to download the entire CTCF data set, use command:
</p>

<div class="code"><pre>
wget -r -np https://genedev.bionet.nsc.ru/hic_out/by_Project/INC_COST_3DBenchmark/CTCF_data/
</pre></div>

<h2 id="predict" class="content-subhead">Step 2. Predict Hi-C Contacts or Insulation Score Data<a href="#predict" class="content-link" title="Heading anchor"></a></h2>

<p>
Use your computational model to predict Hi-C contacts or insulation score data for one of the reference samples.
</p>

<h3>Hi-C Contacts Input</h3>

<p>
The predicted list of contacts should be provided as a <a href="https://en.wikipedia.org/wiki/Tab-separated_values" target="_blank">tab-separated values (TSV) file</a> which contains the following columns:
</p>

<div class="code"><pre>
chr	contact_start	contact_end	contact_count
</pre></div>

<aside><p>Note: No header is allowed in the TSV file.</p></aside>

<p>
An example file can be downloaded <a href="https://genedev.bionet.nsc.ru/hic_out/by_Project/INC_COST_3DBenchmark/predicted_examples/" target="_blank">here</a>.
</p>

<h3>Insulation Scores Input</h3>

<p>
The predicted insulation score track should be provided as a <a href="https://genome.ucsc.edu/goldenPath/help/bedgraph.html">BedGraph</a> file without header (technically a BedGraph-like TSV file).
Columns are the following:
</p>

<div class="code"><pre>
chrom	chrom_start	chrom_end	insulation_score
</pre></div>

<p>
For Paired benchmark two predicted tracks should be provided, both for WT and Mutated samples.
</p>

<h2 id="uploading" class="content-subhead">Step 3. Upload Predicted Data<a href="#uploading" class="content-link" title="Heading anchor"></a></h2>

<p>
The data can be uploaded <a href="upload.php" target="_blank">here</a>.
The uploaded files will be available in dropdown list <a href="submission_form.php" target="_blank">here</a> (see next Step).
</p>

<h2 id="compute_metrics" class="content-subhead">Step 4. Provide Sample Metadata &amp; Compute Metrics<a href="#compute_metrics" class="content-link" title="Heading anchor"></a></h2>

<p>
Once the data is uploaded, go <a href="submission_form.php" target="_blank">here</a>, choose the type of prediction (Single, Paired, or insulation score-only for both types), then fill the form according to labels.
You can use <button disabled>Add test unit</button> button to load example of predicted contacts file.
Alternatively, example samples can be loaded as shown in the figure below.
</p>

