<h2 id="explore_metrics" class="content-subhead">Step 5. Explore Metrics<a href="#explore_metrics" class="content-link" title="Heading anchor"></a></h2>

<p>
The status of the submission is available at the link in success message, or <a href="metrics.php" target="_blank">here</a> by ID.
<strong><font style="color: rgb(66, 184, 221);">Cyan</font></strong> status of submission indicates your job is queued, <strong><font style="color: rgb(223, 117, 20);">orange</font></strong> means your job is running at the server, <strong><font style="color: rgb(28, 184, 65);">green</font></strong> status shows that the job was successfully completed, and <strong><font style="color: rgb(202, 60, 60);">red</font></strong> indicates that there was an error.
If your job has failed, you can try and read job logs (at the bottom of job page), or you can contact us.
</p>

<p>
If the job ends successfully, you will see the metrics page.
Those metrics describe prediction accuracy of your model (see <a href="#metrics_meaning">the section below</a>).
You can find the example of computed metrics checking any ID with the green status or submitting a test unit as described above.
</p>

<h3 id="metrics_meaning" class="content-subhead">What Do Output Metrics Mean?<a href="#metrics_meaning" class="content-link" title="Heading anchor"></a></h3>

<p>
Those metrics reflect how well the model predicts experimental Hi-C data:
</p>

<ul>
<li>Spearman’s correlation between experimental and predicted Hi-C matrices</li>
<li>SCC (stratum adjusted correlation coefficient) from <a href="https://doi.org/10.1101/gr.220640.117" target="_blank">Yang et al. (2017)</a>, implemented by <a href="https://github.com/cmdoret/hicreppy" target="blank">hicreppy</a>, between experimental and predicted Hi-C matrices</li>
<li>Spearman’s correlation of TAD-separation score at each bin (computed using <a href="https://github.com/deeptools/HiCExplorer" target="_blank">HiCExplorer</a> hicFindTADs)</li>
</ul>

<p>
Those metrics reflect how well the model captures differences in 3D genome architecture caused by the rearrangement:
</p>

<ul>
<li>Ectopic interactions computed as in <a href="https://doi.org/10.1038/s41588-018-0098-8" target="_blank">Simona Bianco et al. (2018)</a>.
Briefly, we subtract WT Hi-C map from MUT Hi-C map, distance-normalize the results, and compute values which are 3 standard deviations from the mean of the distribution of the observed differences.
Those outliers are designed as ectopic interactions.</li>
</ul>

<p>
To provide quantitative measurement of ectopic interactions overlap, we use visualization of Precision-Recall (PR) curves, output Area Under the Curve (AUC) metrics, and show the overlap of the predicted and experimentally measured ectopic interactions as compared to randomized controls:</p>

<ul>
<li>Changes in TAD-separation score.
For calculating ectopic insulation score, we divide the TAD-separation score (computed using <a href="https://github.com/deeptools/HiCExplorer" target="_blank">HiCExplorer</a> hicFindTADs) at each bin for WT and MUT conditions and divide one track by another element-wise.
That gives us fold changes of the TAD separation score for each locus (bin).
Then, we design the values falling above 3 standard deviations of the distributions of fold changes as ectopic insulation.</li>
<li>To provide quantitative measurement of ectopic insulatory score changes, we use measures of the overlap between ectopic insulation points identified using experimental and predicted maps (Recall, Precision, PR AUC).</li>
</ul>

<p>Two additional metrics are used to compare predicted and experimental Hi-C contacts with regard to genomic region datasets (Single):</p>

<ul>
<li>Spearman’s correlation between experimental and predicted decay of contact frequency with genomic distance P(s).</li>
<li>Spearman’s correlation between experimental and predicted compartment strength computed as in <a href="https://doi.org/10.1038/s41586-019-1275-3" target="_blank">Martin Falk et al. (2019)</a>.</li>
</ul>

